import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import Navbar from "./Components/Navbar";
import Section from "./Components/Section";
import HalfSection from "./Components/HalfSection.js";
import ProjectEntry from "./Components/ProjectEntry.js"
import front from './images/front.jpeg'
import headshot from './images/headshot.jpeg'
import meaturbeat from './images/meaturbeat.png'


let content2 = <div><img src={front} className="front-picture" alt="Front Picture"/><div className ='front_text_box'><div className='front_text'>Ryan Davis</div></div></div>;
let halfContent1 = <img src={headshot} id="headshot" alt="headshot"/>;
let content3 = <div><HalfSection body = {halfContent1} blue={false} id="halfSection1"></HalfSection> <HalfSection body = {"SomeTextHERE"} blue={true} id="halfSection2"></HalfSection></div>;
let projectContent = <div id = 'projectContainer'><div className='sectionTitle'>Projects</div><div className='seperator'></div><ProjectEntry image = {meaturbeat} title = "Meet Your Beat" description= "This is a project that I made blah blah blah blah blah blah blah blah blah blah blah blah blah blah" /><div className= 'seperator'></div><ProjectEntry image = {meaturbeat} title = "Meet Your Beat" description= "This is a project that I made blah blah blah blah blah blah blah blah blah blah blah blah blah blah" /><div className='seperator'></div></div>;
class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar />
       <Section
          body={content2}
          id="section1"
        /> 
        <Section
          body = {content3}
          id='section2'
        />
        <Section
        body = {projectContent}
        id = 'section3'
        blue = {true}
        />
      </div>
    );
  }
}

export default App;
